import { useState } from "react";
import ProjectsCard from "./ProjectsCard/ProjectsCard";

const ProjectsList: React.FC = () => {
  const [isSpanish, setSpanish] = useState(true);
  const projects = [
    {
      title: isSpanish ? "AutoEscuela Santa Fe" : "",
      description: [
        "Permite organizar horarios, registrar agendas de instructores, programar clases, mantener datos de alumnos e instructores, " + 
        "gestionar pagos, generar reportes estadísticos, llevar registros financieros y administrar el calendario de la autoescuela."
      ],
      items: [
        "Agenda inteligente",
        "Calendario y control de clases",
        "Historias y estadísticas",
        "Finanzas y control de pagos"
      ],
      technologies: [
        "HTML",
        "CSS",
        "Bootstrap",
        "Spring",
        "Java",
        "Maven",
        "PostgreSQL",
      ],
      imageSrc: [
        "/assets/images/aesf/01.png",
        "/assets/images/aesf/02.png",
        "/assets/images/aesf/03.png",
        "/assets/images/aesf/04.png",
        "/assets/images/aesf/05.png",
        "/assets/images/aesf/06.png",
        "/assets/images/aesf/07.png",
      ],
    },
    // agregar mas experiencias aca:
  ];

  return (
    <div>
      {projects.map((project, index) => (
        <ProjectsCard
          key={index}
          title={project.title}
          description={project.description}
          items={project.items}
          technologies={project.technologies}
          images={project.imageSrc}
        />
      ))}
    </div>
  );
};

export default ProjectsList;
